import './Icon.css';
import Media from 'react-media';

// Icon available compoennt
export default function REturnIcon(props) {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall icons={props.icons} Text={props.Text} />}
     {matches.medium && <ScreenLarge icons={props.icons} Text={props.Text} />}
     {matches.large && <ScreenLarge icons={props.icons} Text={props.Text} />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = (props) => (
 <div className='wrp-box-icons'>
  <span>{props.icons}</span>
  <p>{props.Text}</p>
 </div>
);
export const ScreenSmall = (props) => (
 <div className='wrp-box-icons-sm'>
  <span>{props.icons}</span>
  <p>{props.Text}</p>
 </div>
);
